css:
.build {
  height: 100%;
  font-family: 'Menlo', 'Consolas', 'DejaVu Sans Mono', monospace;
}
.build .title {
  transition: background-color 0.2s ease-in;
}
.build .build-timer {
  display: inline-block;
  width: 5em;
  margin-right: 10px;
}
.build .title.error {
  color: white;
  background-image: none;
  background-color: #d92626;
}
.build .title.success {
  color: white;
  background-image: none;
  background-color: #20b684;
}
.build .title.warning {
  color: white;
  background-image: none;
  background-color: #cc8533;
}
.build .output {
  transition: 0.5s ease-in-out;
  transition-property: width, height;
  padding: 10px 0 3em 10px;
  min-height: 100px;
  overflow: auto;
  word-wrap: break-word;
  white-space: pre-wrap;
}
.build .status {
  position: absolute;
  bottom: 0;
  height: 3em;
  width: 100%;
}
.build .status h1 {
  height: 100%;
}
.build a {
  text-decoration: underline;
}
.btn-container .btn {
  float: right;
  margin: 10px 10px 0 0;
  color: #6494ed;
}
.btn-container .icon::before {
  margin: 0;
}
.btn-container .new-row {
  clear: both;
}
atom-panel.left .build .btn-container,
atom-panel.right .build .btn-container {
  float: none !important;
}
atom-panel.left .build .btn-container .new-row,
atom-panel.right .build .btn-container .new-row {
  clear: none;
}
atom-panel.left .build .btn-container .btn:last-child,
atom-panel.right .build .btn-container .btn:last-child {
  margin-left: 10px;
}
atom-panel.left .build .output,
atom-panel.right .build .output {
  min-width: 200px;
  padding-right: 10px;
}
#build-status-bar .status-success {
  color: #73c990;
}
#build-status-bar .status-error {
  color: #ff6347;
}
